import React from 'react';
import ClientHeader from './ClientHeader';
import ClientSidebar from './ClientSidebar';

function ClientFiles() {
    const DisplayData = [{
        "id":1,
        "brand_name":"Brand one",
        "last_update":"02 March, 17:00",
        "file_size":"true"
    },
    
    {
        "id":2,
        "brand_name":"Brand two",
        "last_update":"02 March, 17:00",
        "file_size":"true"
    },
    
    {
        "id":3,
        "brand_name":"Brand three",
        "last_update":"02 March, 17:00",
        "file_size":"true"
    },
    
    {
        "id":4,
        "brand_name":"Brand four",
        "last_update":"02 March, 17:00",
        "file_size":"true"
    }];
    return (
        <div className='container'>
            <ClientHeader />
            <ClientSidebar />
            <div className="home-bar">
                Files
            </div>
            <section className="content-blocks">
                <ul className='list-heads'>
                    <li>BRANDS</li>
                    <li>LAST UPDATE</li>
                    <li>FILE SIZE</li>
                </ul>
                {DisplayData.map(
                    (info) => {
                        return (
                            <div className="list-items">
                                <ul>
                                    <li>
                                        <span className="brand_green_tag">hi</span>
                                    </li>
                                    <li>{info.brand_name}</li>
                                    <li>{info.last_update}</li>
                                    <li>{info.file_size}</li>
                                </ul>
                            </div>
                        )
                    }
                )}

            </section>
        </div>
    );
}

export default ClientFiles;
